import React, { Component } from 'react';
import "./navbar.css";
import { Navbar, NavDropdown, Nav, Image } from "react-bootstrap";
import Logo from "../../assets/index.jpeg";
class Navbarweb extends Component {

    render() {
        return (
            <React.Fragment>

                <Navbar collapseOnSelect expand="lg" className="adjustnav">
                    <Navbar.Brand href="#home" ><span >  <Image src={Logo} width='145px' height='auto' /></span></Navbar.Brand>
                    <Navbar.Toggle className=" navbar-toggler-icon  " aria-controls="responsive-navbar-nav" />
                    <Navbar.Collapse id="responsive-navbar-nav">
                        <Nav className="ml-auto" style={{ color: 'black' }}>
                            <Nav.Link href="#features">HOME</Nav.Link> &nbsp;&nbsp;&nbsp;&nbsp;
                            <Nav.Link href="#pricing">ABOUT US</Nav.Link>&nbsp;&nbsp;&nbsp;&nbsp;
                            <Nav.Link href="#pricing">CONNECT WITH US</Nav.Link>


                        </Nav>

                    </Navbar.Collapse>


                </Navbar>

            </React.Fragment>
        );
    }


}
export default Navbarweb;
